var initialState = [
    {
        id: 1,
        name: "Iphone 8x",
        image: "",
        description: "San Pham cua Apple",
        price: 300,
        inventory: 10
    },
    {
        id: 2,
        name: "Samsum Galaxy",
        image: "",
        description: "San Pham cua SamSum",
        price: 250,
        inventory: 12
    }
];

const products = (state= initialState, action) =>{
    switch(action.type){
        default: return [...state];
    }
}

export default products;
